import React,{useEffect} from 'react'
import "./home.css";
import {useSelector} from 'react-redux'
import Footer from "../../components/footer/Footer";
import Navbar from "../../components/navbar/Navbar";
import SearchBar from "../../components/SearchBar/SearchBar"
import HomeBody from '../../components/HomeBody/HomeBody';
import HomeEnd from '../../components/HomeEnd/HomeEnd';
function Home() {
  const schools=useSelector((state)=>state.schools)
  console.log(schools)
  let PopSchools;
  for(let i=0;i<schools.lengthl;i++){
    if (schools[i].Name =="Lebanese American University"){
      PopSchools.push(schools[i])
    }
    if (schools[i].Name == "American University of Beirut") {
      PopSchools.push(schools[i])
    }
    if (schools[i].Name == "Saint Joseph University") {
      PopSchools.push(schools[i])
    }
    console.log(PopSchools)
    
  }
  return (
    <div>
      <Navbar />
        <SearchBar placeholder="Search for your School..." data={schools} />
      <HomeBody />
      <HomeEnd />
      <Footer />
    </div>
  )
}

export default Home
